const searchRedirect= () => {

    window.fbAsyncInit = function() {
        FB.init({
          appId            : '2605624903036488',
          autoLogAppEvents : true,
          xfbml            : true,
          version          : 'v8.0'
        });
      };

    FB.getLoginStatus(function(response) {
        statusChangeCallback(response);
    });



    useEffect(() =>{
        console.log('Will redirect');













    })

    return(
        <div>
